import "./EndingScreen.css";
import { useState } from "react";
import NewGame from "./newGame.js";

export default function EndingScreen() {
  const [page, setPage] = useState("menu");

  return (
    <div className="container">
          <h1 className="gameEndingText">Game over</h1>
          <button className="newGameBtn" onClick={() => setPage("newGame")}>New Game</button>
          <button className="backToStartingScreen" onClick={() => setPage("startingScreen")}>Back to starting scene</button>
    </div>
  );
}
